function C(l,e,r){for(let v=0;v<r;v++){let x=v+1,y=v+2;x>=r&&(x=r-1),y>=r&&(y=r-1);let o=v*e,s=x*e,n=y*e;for(let t=0;t<e;t++){let p=t+1,f=t+2;p>=e&&(p=e-1),f>=e&&(f=e-1);let c=l[o+t],j=l[o+p],m=l[o+f],k=l[s+t],z=l[s+f],M=l[n+t],A=l[n+p],q=l[n+f],u=(z-k)*2+(m+q)-(c+M),b=(A-j)*2+(M+q)-(c+m),B=Math.min(Math.sqrt(u*u+b*b),1);l[o+t]=B}}}export{C as process};
